INSERT INTO `ps_cms_lang` (`id_cms`, `id_lang`, `id_shop`, `meta_title`, `meta_description`, `meta_keywords`, `content`, `link_rewrite`) VALUES
(1, 1, 1, 'Dostawa', 'Nasze Zasady i warunki dostawy', ' pack,stan,dostawa,opóznienie,paczka,wysyłka', '<h2>Przesyłki i zwroty</h2>\n<h3>Twoja przesyłka paczki</h3>\n<div class="tw-ta-container hide-focus-ring tw-nfl" id="tw-target-text-container">\n<p class="tw-data-text tw-text-large XcVN5d tw-ta" id="tw-target-text" style="text-align:left;" dir="ltr"><span lang="pl" xml:lang="pl">Paczki są zazwyczaj wysyłane w ciągu 2 dni od otrzymania płatności i wysyłane za pośrednictwem UPS ze śledzeniem i nadaniem bez podpisu. Jeśli wolisz dostawę UPS Extra z wymaganym podpisem, zostanie naliczona dodatkowa opłata, dlatego prosimy o kontakt przed wybraniem tej metody. Bez względu na to, jaką wybierzesz przesyłkę, udostępnimy Ci link do śledzenia przesyłki online. Opłaty za wysyłkę obejmują opłaty manipulacyjne i opłaty za pakowanie, a także koszty wysyłki. Opłaty manipulacyjne są stałe, natomiast opłaty za transport różnią się w zależności od całkowitej wagi przesyłki. Zalecamy zgrupowanie artykułów w jednym zamówieniu. Nie możemy grupować dwóch odrębnych zamówień złożonych osobno, a opłaty za wysyłkę będą miały zastosowanie do każdego z nich. Twoja paczka zostanie wysłana na własne ryzyko, ale szczególną uwagę należy zwrócić na ochronę delikatnych przedmiotów. Pudła mają duże rozmiary, a Twoje przedmioty są dobrze chronione.</span></p>\n</div>\n<div class="tw-ta-container hide-focus-ring tw-nfl" id="tw-target-rmn-container">\n<pre class="tw-data-placeholder tw-text-small tw-ta" id="tw-target-rmn" style="text-align:left;" dir="ltr"><span> </span></pre>\n</div>', 'dostawa'),
(2, 1, 1, 'Nota prawna', 'Nota prawna', 'Prawa,nota', '<h2>Legalna strona</h2>\n<p>Ta strona była zrobiowa z miłoscią i dużą przyjemnością</p>', 'nota-prawna'),
(3, 1, 1, 'Regulamin użytkowania', 'Nasze warunki użytkowania', 'sprzedaż,warunki,regulamin,użytkownik', '<h1><strong>Regulamin strony</strong></h1>\n<h4><br />Cieszymy się, że trafiłeś/aś na nasz portal internetowy http://localhost/prestashop/ Pixerio (dalej zwany: "Stroną Internetową Pixerio"). Mamy nadzieję, że skorzystasz z naszej oferty i znajdziesz wiele sposobów na kształtowanie swojego prywatnego i zawodowego środowiska informatycznego. Prosimy, abyś poświęcił trochę czasu na uważne zapoznanie się z poniższymi informacjami. Do zapisania lub wydrukowania tekst wystarczy kliknięcie myszką.</h4>\n<h2><br /><strong>1. Informacje ogólne</strong></h2>\n<h4><br />Wszelkie sposoby korzystania ze Strony Internetowej Pixerio podlegają niniejszemu Regulaminowi. Pixerio zastrzega sobie prawo do poprawiania, modyfikowania lub zamiany Regulaminu w dowolnym momencie i bez konieczności powiadamiania. Poprzez zalogowanie się lub, jeśli logowanie nie jest wymagane, poprzez uzyskanie dostępu lub korzystanie ze Strony Internetowej, akceptujesz niniejszy Regulamin w jego obecnej wersji w celu korzystania ze Strony Internetowej. Korzystasz ze Strony Internetowej Pixerio na własne ryzyko.</h4>\n<h2><br /><strong>2. Dostępność Strony Internetowej Pixerio</strong></h2>\n<h4><br />Użytkownik przyjmuje do wiadomości, że Pixerio wyraźnie wyłącza wszelką odpowiedzialność za nieprzerwaną dostępność Strony Internetowej. Ponadto Pixerio zastrzega sobie prawo do całkowitego lub częściowego zatrzymania działania i/lub udostępniania niniejszej Strony Internetowej lub ograniczenia dostępu do niej w dowolnym momencie i bez konieczności powiadamiania.</h4>\n<h2><br /><strong>3. Korzystanie ze Strony Internetowej Pixerio oraz udostępniane treści i informacje</strong></h2>\n<h4><br />O ile nie zaznaczono inaczej, wszelkie informacje publikowane przez Pixerio będą udostępnione użytkownikowi bezpłatnie. Każdy użytkownik może korzystać i zapisywać udostępniane informacje dla swoich osobistych potrzeb. Jakikolwiek inny sposób użycia informacji, szczególnie każdy rodzaj powielania, zmiany lub włączenia do jakiegokolwiek rodzaju publikacji lub reklamy jest dozwolony wyłącznie po uzyskaniu uprzedniej zgody Pixerio lub właściwego właściciela informacji. Pixerio szczególnie zwraca uwagę na fakt, że treści i informacje mogą podlegać prawom ochronnym; wszelkie takie prawa ochronne (w szczególności dotyczące nazw i znaków towarowych) pozostaną zawsze własnością Pixerio. Wszystkie informacje zostały zebrane i sprawdzone przez Pixerio z największą starannością i są dostarczone przez Pixerio według najlepszej wiedzy i przekonania.<br />Jeśli informacje pochodzą od osoby trzeciej zostały przyjęte bez żadnych zmian. Każdy użytkownik jest odpowiedzialny za sprawdzenie, czy podane informacje są prawidłowe, kompletne i/lub aktualne. Odpowiedzialność Pixerio za wszelkie szkody spowodowane niepoprawnością, niekompletnością lub nieaktualnością dostarczonych informacji, a także wszelka odpowiedzialność za szkody wynikające z jakiejkolwiek ewentualnej błędnej interpretacji informacji dostarczonych przez użytkownika są ograniczone do rażącego zaniedbania lub zamierzonego zachowania Pixerio.</h4>\n<h4><br />Ponadto uzyskując dostęp i/lub korzystając ze Strony Internetowej Pixerio, Użytkownik nie będzie podejmował żadnych z następujących czynności: – naruszanie zasad współżycia społecznego sposobem korzystania; – naruszanie jakiegokolwiek prawa własności intelektualnej lub jakiegokolwiek innego prawa własności; – przesyłanie wszelkich treści zawierających wirusy, tzw. konia trojańskiego lub jakiegokolwiek innego programu, który mógłby uszkodzić dane; – przekazywanie, przechowywanie lub przesyłanie hiperłączy lub treści, do których użytkownik nie jest uprawniony, w szczególności w przypadkach, gdy takie hiperłącza lub treści naruszają zobowiązanie do zachowania poufności lub przepisy prawa; lub – rozpowszechnienie reklamowych lub niechcianych e-maili (tzw. „spam“) lub niezgodnych z prawdą ostrzeżeń przed wirusami, wadami lub podobnym materiałem, a także użytkownik nie będzie proponował lub zapraszał do uczestnictwa w jakiejkolwiek loterii, systemie kuli śnieżnej, łańcuszkach, piramidach lub podobnych aktywnościach.<br />Co więcej, Pixerio nie będzie odpowiedzialne za jakiekolwiek szkody wynikające z niewłaściwego wykorzystania przez użytkownika dostarczonych informacji.</h4>\n<h3><br /><em>© 2020 Pixerio</em> <br /><br /><br /></h3>', 'warunki-uzytkowania'),
(4, 1, 1, 'O nas', 'Dowiedz się więcej o nasz', 'informacja,o nas', '<h1>Pixerio</h1>\n<p>Nasz sklep oferuje najpieknięjsze zdjęcia od profesjonalnych forografów w wysokiej rozdzielczości.</p>', 'o-nas'),
(5, 1, 1, 'Bezpieczna metoda płatności', 'Nasza bezpieczna metoda płatności', ' ssl, visa, mastercard, paypal', '<h2>Bezpieczna płatność</h2>\n<p>Z wykorzystaniem SSL</p>\n<h3>Przez Visa/Mastercard/Paypal</h3>', 'bezpieczna-platnosc');
